package Lec_4;

import java.util.*;

public class Print_Natural_number {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
       
		Scanner s= new Scanner(System.in);
		
		int n= s.nextInt();
		
		int i= 1; // i indicate ith Natural Number.
		
		while(i<=n) {
			
			System.out.println(i);
			
			i=i+1;
			
		}
		
		
		
		
		
	}

}
